import React from 'react'
import {
  List,
  Datagrid,
  TextField,
  DateField,
  EditButton,
  DeleteButton,
  UrlField,
  
} from 'react-admin'
import Icon from '@material-ui/icons/Person';
import { makeStyles } from '@material-ui/core/styles';

export const VisitorIcon = Icon;

// The `Datagrid` component uses makeStyles, and supports overriding styles through the `classes` property 
const useStyles = makeStyles({
    table: {
        backgroundColor: 'Lavender',
    },
    headerCell: {
        backgroundColor: 'MistyRose',
    },
});

const SongList = (props) => {
  return (
    <List {...props}>
      <Datagrid>
        <TextField source='id' />
        <TextField source='song_name' />
        <TextField source='song_duration' />
        <DateField source='date_added' />  
        <TextField source='stream_count' label='Stream Count'/>
        <TextField source="files.rawFile.path"  label='Path' />  
        <UrlField target="_blank" source="song_image" style={{color:'orange'}}/>
        <EditButton label="View" basePath='/songs' style={{color:'#00ffff'}} />
        <DeleteButton basePath='/songs' />
      </Datagrid>
    </List>
  )
}

export default SongList
